    [],nt"num_tags": 8,nt"name": "climate-prediction-center-cpc-u-s-daily-snow-depth-observations-8d700",nt"isopen":
    false,nt"url": null,nt"notes": "Observational reports of current snow depth
    (at 1200 UTC) are made by members of the NWS Automated Surface Observing Systems
    (ASOS) network and NWS Cooperative Observer Network (COOP). Reports from approximately
    2,000 stations across the US including Alaska and Hawaii are sent on a daily basis
    to the Climate Prediction Center (CPC). CPC processes these reports once per day.
    All reports for the same day are put into an ASCII text file whose name includes
    the date of observation. These data are used by CPC in its role of supporting the
    Joint Agricultural Weather Facility (JAWF).",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
